    protected override async Task OnInitializedAsync()
    {
        listaClientes = await http.GetFromJsonAsync<ClientesVM[]>("api/Ventas/ListarClientes");
        listaCiclos = await http.GetFromJsonAsync<CiclosVM[]>("api/Ventas/ListarCiclos");
